-- Миграция 017: Полная загрузка расценок СБЦ ИГДИ 2004 из RTF
-- Источник: СБЦ Инженерно-геодезические изыскания (RTF)

DO $$
DECLARE
    v_doc_id UUID;
BEGIN
    SELECT id INTO v_doc_id FROM norm_docs WHERE code = 'SBC_IGDI_2004';
    IF v_doc_id IS NULL THEN
        VALUES ('SBC_IGDI_2004', 'СБЦ на инженерные изыскания для строительства. Инженерно-геодезические изыскания', '2004', '2001-01-01', 'RTF')
        RETURNING id INTO v_doc_id;
    END IF;

    DELETE FROM norm_items WHERE doc_id = v_doc_id AND table_no BETWEEN 8 AND 84;


    RAISE NOTICE 'Загружено расценок: %', (SELECT COUNT(*) FROM norm_items WHERE doc_id = v_doc_id AND (source_ref->>'source') = 'rtf_2004');
END $$;