    (v_doc_id, 12, '1', 'Изыскания новых железных и автомобильных дорог: I и II технических категорий - кат. I', '1 км трассы', NULL, 16114.00, 6375.00, '{"descriptor": "Изыскания новых железных и автомобильных дорог: I и II технических категорий", "table_title": "Инженерно-геодезические изыскания трасс железных и автомобильных дорог приведены в таблице 12 и учитывают расходы на выполнение следующих работ: составление программы изысканий; камеральное трассирование вариантов трасс железных и автомобильных дорог; рекогносцировочное обследование на местности намеченных вариантов трасс; комплекс геодезических работ по полевому трассированию выбранного варианта с проложением теодолитного хода по трассе; закрепление временными знаками углов поворота и промежуточных точек; разбивка пикетажа, элементов плана и кривых с выносом характерных точек и пикетов на кривую; зарисовка ситуации и описание условий проложения трассы; нивелирование по оси трассы и поперечникам; геодезическая привязка трассы к пунктам опорной сети; съемка пересечений, узких полос и отдельных небольших участков со сложным рельефом (косогоры, овраги и т.п.)", "column": "I", "category": "I"}'::jsonb, '{"table": 12, "row": "1", "source": "rtf_2004"}'::jsonb),
