    (v_doc_id, 13, '1', 'Изыскания трасс магистральных трубопроводов - кат. I', '1 км трассы', NULL, 5790.00, 3302.00, '{"descriptor": "Изыскания трасс магистральных трубопроводов", "table_title": "Изыскания трасс магистральных трубопроводов приведены в таблице 13 и учитывают расходы на выполнение следующих работ: составление программы изысканий; камеральное трассирование вариантов трасс магистрального трубопровода по картам и планам; рекогносцировочное обследование намеченных вариантов трассы трубопровода; предварительные изыскания конкурентоспособных вариантов трассы и окончательные изыскания (полевое трассирование) выбранного варианта трассы трубопровода; закрепление временными знаками углов поворота, створных точек и мест переходов через препятствия; геодезическая привязка положения трассы к пунктам опорной геодезической сети; проложение теодолитных ходов по трассе с разбивкой и закреплением пикетажа; нивелирование по пикетажу трассы и контрольные измерения; съемка пересечений, узких полос и отдельных небольших участков со сложным рельефом (косогоры, овраги и т.п.) в масштабе 1:500 - 1:2000; горизонтальная съемка в масштабе 1:5000 - 1:10000 полосы местности в пределах зоны влияния трубопровода; обследование дорожной сети в районе проложения трубопровода; вычисление координат и высот точек трассы; составление плана и продольного профиля трассы, профилей переходов через препятствия и различных ведомостей; подготовка и выпуск отчетных материалов", "column": "I", "category": "I"}'::jsonb, '{"table": 13, "row": "1", "source": "rtf_2004"}'::jsonb),
