    (v_doc_id, 72, '1', 'Камеральное трассирование линейных сооружений приведены в таблице 72 и даны для категорий сложности, приведенных в таблице 11 части 1 Справочника. Ценами учтены расходы на выполнение следующих работ: анализ собранных картографических и аэрокосмических материалов; изучение особенностей рельефа, ситуации и других природных условий района по всем вариантам проложения трассы; выявление и нанесение на карты местоположения строящихся или вновь построенных объектов, влияющих на направление и положение трассы; предварительное нанесение трассы на карты и планы с учетом технических условий, природных и экономических факторов; трассирование линии по картам, планам и аэрокосмическим материалам с уточнением мест переходов трассы через естественные и искусственные препятствия с ориентировочным определением их величины и возможных обходов препятствий; составление продольного профиля с подсчетом основных показателей трассы (характеристика плана линии, протяжение неблагоприятных мест, количество пересечений с водотоками, коммуникациями, пересекаемые угодья) с составлением сопоставительной ведомости; вычерчивание трассы на картах (планах) и продольного профиля с изготовлением копий; подготовка данных для технико-экономического сравнения вариантов и рекомендаций по выбору основного варианта направления трассы - 1:100000 - кат. I', '1 км трассы', 149.00, NULL, NULL, '{"descriptor": "1:100000", "table_title": "Камеральное трассирование линейных сооружений приведены в таблице 72 и даны для категорий сложности, приведенных в таблице 11 части 1 Справочника. Ценами учтены расходы на выполнение следующих работ: анализ собранных картографических и аэрокосмических материалов; изучение особенностей рельефа, ситуации и других природных условий района по всем вариантам проложения трассы; выявление и нанесение на карты местоположения строящихся или вновь построенных объектов, влияющих на направление и положение трассы; предварительное нанесение трассы на карты и планы с уч